import React from "react";
import Breadcrums from "../components/Breadcrumbs";
import { CatalogList } from "../utils/constants";

const CatalogPage = () => {
  return (
    <>
      <Breadcrums />
      <div className="container">
        <div className="row catalog text-center">
          {CatalogList.map((item) => (
            <div className="col-12 col-sm-12 col-md-4 col-lg-4 col-xl-4">
              <a href="ru/catalog/myagkaya-mebel">
                <span className="razdel_cataloga_img">
                  <img
                    src="/assets/components/phpthumbof/cache/catalog3.02fe89b980c79deb061c53e6c182e85f3.jpg"
                    alt={item.title}
                  />
                </span>
                <span className="razdel_cataloga_title">{item.title}</span>
              </a>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default CatalogPage;
